import React, { useState } from 'react';
import { Flex, Heading, useColorMode, useColorModeValue, Text, Container, Grid, GridItem, extendTheme, withDefaultColorScheme} from '@chakra-ui/react';
import { useHistory } from 'react-router-dom';
import { DarkMode } from './DarkMode';
import tokenProvider from './TokenProvider';
import Sidebar from './Sidebar';
import axios from 'axios'; // API 

function StocksPage() {
    const { toggleColorMode } = useColorMode(); /** Changes ColorMode */
    const formBackground = useColorModeValue("gray.100", "gray.700") /** Light Mode = gray.100,     Dark Mode = gray.700 */
    const [modeName, setModeName] = useState('Dark Mode'); /** Determines Light or Dark Mode Name */
    const [test, setTest] = useState('');

    function get_GME_PRICE() {
        try {
            console.log("GET")
            axios.get('http://localhost:8080/api/v1/stocks').then(res => setTest(res.data.ask))

            setInterval(async () => {
                console.log("GET - 5MIN")
                await axios.get('http://localhost:8080/api/v1/stocks').then(res => setTest(res.data.ask))
            }, 1 * 60 * 5000)
        }        
        catch (err) {
            console.log(err)
        }
    }

    get_GME_PRICE();

    return (
        <Flex w="100%">
            <Sidebar />
            <Container maxW="container.xl">
                <Grid 
                h="400px"
                templateColumns="repeat(5, 1lfr)"
                gap={4}
                >
                    <GridItem rowSpan={2} colSpan={1} bg="tomato">GME = {test}</GridItem>
                    <GridItem colSpan={2} bg="papayawhip"/>
                    <GridItem colSpan={2} bg="papayawhip"/>
                    <GridItem colSpan={3} bg="tomato" />
                </Grid>
            </Container>
        </Flex>
    )
}

export default StocksPage
